    text: 'text_1',
    day: '1:1',
    reminder: true
  },
  {
    id:2,
    text: 'text_2',
    day: '2:2',
    reminder: false
  },]
  )

  return (
    <div className="container">
      <Header />
      <Tasks />
    </div>
  );
}

export default App;
